import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { HomePage } from "./components/HomePage/HomePage";
import { NavBar } from "./components/NavBar/NavBar";
import { ReactQueryDevtools } from "react-query/devtools";

function App() {
  return (
    <div className="App">
      <ReactQueryDevtools />
      <NavBar />
      <HomePage />
    </div>
  );
}

export default App;
